import React from "react";

const ListRender = () => {
  let list = ["Juan", "Lazaro", "Thiago", "Luan", "Pedro"];
  return (
    <div>
      <h2>Lista de presen√ßa</h2>
      <ul>
          <li>
              {
                  list.map((item) =>
                    item.toLocaleUpperCase
                  )
              }
          </li>
      </ul>
    </div>
  );
};
export default ListRender;
